import {Route} from 'react-router-dom';

import Welcome from "./components/Welcome";
import Product from './components/Product';

function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/product">
        <Product />
      </Route>
    </div>
  );
}

export default App;
